import React from "react";
// import CountryButton from "./CountryButton";
// import ContentApiDetails from "./ContentApiDetails";
// import { IconSpinner } from "../Icon/IconList";
import ApiCovidFetch from "./ApiCovidFetch";
import DisplayDetail from "./DisplayDetail";
import CovidLineChart from "./CovidChart";
import ToDoInstruction from "./ToDoInstruction";

const CovidPage = () => {
  return (
    <ApiCovidFetch>
      <div className="main-wrapper-content">
        <div className="container">
          <DisplayDetail />
          <CovidLineChart />
          <ToDoInstruction />
        </div>
      </div>
    </ApiCovidFetch>
  );
};

export default CovidPage;
